    "2013-03-15T21:23:28.288503",nt"name": "landslide-deposit-boundaries-for-the-little-north-santiam-river-basin-oregon",nt"isopen":
    false,nt"url": null,nt"notes": "This layer is an inventory of existing
    landslides deposits in the Little North Santiam River Basin, Oregon (2009). Each
    landslide deposit shown on this map has been classified according to a number of
    specific characteristics identified at the time recorded in the GIS database. The
    classification scheme was developed by the Oregon Department of Geology and Mineral
    Industries (Burns and Madin, 2009). Several significant landslide characteristics
    recorded in the database are portrayed with symbology on this map. The specific
    characteristics shown for each landslide are the activity of landsliding, landslide
    features, deep or shallow failure, type of landslide movement, and confidence of
    landslide interpretation. These landslide characteristics are determined primarily
    on the basis of geomorphic features, or landforms, observed for each landslide.
    This work was completed as part of the Master's thesis "Turbidity Monitoring and
    LiDAR Imagery Indicate Landslides are Primary Source of Suspended-Sediment Load
    in the Little North Santiam River Basin, Oregon, Winter 2009-2010" by Steven Sobieszczyk,
    Portland State University and U.S. Geological Survey. Data layers in this geodatabase
    include: landslide deposit boundaries (Deposits); field-verfied location imagery
    (Photos); head scarp or scarp flanks (Scarp_Flanks); and secondary scarp features
    (Scarps).The geodatabase template was developed by the Oregon Department of Geology
    and Mineral Industries (Burns and Madin, 2009).",nt"license_title": null,nt"extras":
